import { Rllista } from "./Rllista";
import { useState, useEffect } from "react";
import {
  persones,
  competidors,
  administradors,
  headerConfig,
} from "../models/instancies.js";

export function Container() {
  // Estado
  const [titol, setTitol] = useState("Titol");
  const [headerConf, setCapçalera] = useState([]);
  const [datos, setDatos] = useState([]);
  const [copiaDatosOriginales, setDatosLlista] = useState([]);
  const [total, setTotal] = useState("");
  const [capçaleraBoolean, setCapçaleraBoolean] = useState(false);
  const [personaBoolean, setPersonaBoolean] = useState(false);
  const [competidorBoolean, setCompetidorBoolean] = useState(false);
  const [administradorBoolean, setAdministradorBoolean] = useState(false);
  const [ordenarBoolean, setOrdenarBoolean] = useState(false);
  const [filtrarBoolean, setFiltrarBoolean] = useState(false);
  const [totalitzarBoolean, setTotalitzarBoolean] = useState(false);

  // Datos originales
  const datosOriginales = persones.concat(competidors, administradors);

  // Funciones
  const addCapçalera = () => {
    if (!capçaleraBoolean) {
      setCapçaleraBoolean(true);
      headerConfig.forEach((capçalera) => setCapçalera((prev) => [...prev, capçalera]));
    }
  };

  const addPersona = () => {
    if (!personaBoolean) {
      setPersonaBoolean(true);
      const nuevosDatos = [...datos, ...persones];
      setDatos(nuevosDatos);
      setDatosLlista(nuevosDatos);
      setCopiaDatosOriginales(nuevosDatos);
    }
  };

  const addCompetidor = () => {
    if (!competidorBoolean) {
      setCompetidorBoolean(true);
      const nuevosDatos = [...datos, ...competidors];
      setDatos(nuevosDatos);
      setDatosLlista(nuevosDatos);
      setDatosOriginales(nuevosDatos);
    }
  };

  const addAdministrador = () => {
    if (!administradorBoolean) {
      setAdministradorBoolean(true);
      const nuevosDatos = [...datos, ...administradors];
      setDatos(nuevosDatos);
      setDatosLlista(nuevosDatos);
      setDatosOriginales(nuevosDatos);
    }
  };

  const canviTitol = () => {
    const tt = prompt("Nou titol:");
    if (tt) {
      setTitol(tt);
    }
  };

  const Ordenar = () => {
    if (!ordenarBoolean) {
      setOrdenarBoolean(true);
      const copiaDatos = datos.slice().sort(ordenarNom);
      setDatos(copiaDatos);
    } else {
      Reiniciar();
    }
  };

  const ordenarNom = (a, b) => {
    return a.nom > b.nom;
  };

  const Filtrar = () => {
    if (!filtrarBoolean) {
      setFiltrarBoolean(true);
      const copiaDatos = datosOriginales.filter((elem) => elem.alçada > 170);
      setDatos(copiaDatos);

      // Llamar a Totalitzar solo si se ha totalizado antes
      if (totalitzarBoolean) {
        Totalitzar();
      }
    } else {
      Reiniciar();
    }
  };

  const Totalitzar = () => {
    setTotalitzarBoolean(true);
    const totalitzarAlçada = datos.map((ele) => ele["alçada"]);
    const resultat = totalitzarAlçada.reduce((acum, valor) => acum + valor, 0);
    setTotal("Total: " + resultat);
  };

  const Reiniciar = () => {
    setOrdenarBoolean(false);
    setFiltrarBoolean(false);
    setDatos([...copiaDatosOriginales]);

    // Resetear el total si se ha totalizado antes
    if (totalitzarBoolean) {
      Totalitzar();
    }
  };

  return (
    <>
      <h1>{titol}</h1>
      <h1>Llista</h1>
      <div>
        <Rllista data={datos} header={headerConf} />
        <p>{total}</p>
        <button onClick={canviTitol}>Títol</button>
        <button onClick={addCapçalera}>Capçalera</button>
        <button onClick={addPersona}>Persona</button>
        <button onClick={addCompetidor}>Competidor</button>
        <button onClick={addAdministrador}>Administrador</button>
        <button onClick={Ordenar}>Ordenar</button>
        <button onClick={Filtrar}>Filtrar</button>
        <button onClick={Totalitzar}>Totalitzar</button>
      </div>
    </>
  );
}
